import Item from "./Item";
function Expences(props) {
  const del = (data) => {
    props.remove(data);
  };
  return (
    <div className="expences">
      {props.item.map((Expences) => (
        <Item
          id={Expences.id}
          date={Expences.item_date}
          name={Expences.item_name}
          price={Expences.item_price}
          clear={del}
        />
      ))}
    </div>
  );
}
export default Expences;
